import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the first "Add to Cart" button. Using .first() is a robust strategy.
    const firstAddToCartButton = page.locator('.add-to-cart').first();
    await firstAddToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Click the button to add the product to the cart
    await firstAddToCartButton.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Verify the action by waiting for the success notification to appear
    const notification = page.locator('.notification.success');
    await notification.waitFor({ state: 'visible', timeout: 5000 });

    // Extract the cart text to verify the item count updated
    const cartElement = page.locator('div.cart');
    const cartText = await cartElement.textContent();

    // Final screenshot showing the updated cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_verification.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_verification.png'));

    if (!cartText.includes('1')) {
      throw new Error(`Cart text did not update correctly. Expected to contain '1', but got: "${cartText}"`);
    }

    return {
      success: true,
      action: "Added the first product to the cart and verified the cart counter updated.",
      extractedData: {
          cartText: cartText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
